result:
ul {
	list-style-type: none;
	padding: 0;
	margin: 0;
}

li {
	display: inline-block;
	margin: 0 10px;
}

a {
	color: #000;
}

.item {
	width: 92%;
	overflow: hidden;
	margin: 0 auto;
	position: relative;
	display: block;
	border-bottom: 1px solid #eeeeee;
	padding: 12px 0;
}

.ex1-left {
	width: 63%;
	float: left;
	display: flex;
	flex-wrap: wrap;
	align-content: space-between
}

.categoryName {
	color: #f94d17;
	border: 1px solid #f94d17;
	font-size: 10px;
	text-align: center;
	display: inline-block;
	padding: 0px 4px;
}

.ex1-img {
	overflow: hidden;
	width: 34%;
	height: 21.3vw;
	float: right;

	.ex-img {
		min-height: 21.3vw;
		background-size: 64px;
		background-color: #F5F5F5;
		display: block;
		width: 100%;
	}
}

.ex-title {
	font-size: 15px;
}

.ex1 {
	.ex-title {
		display: -webkit-box;
		overflow: hidden;
		width: 100%;
		text-overflow: ellipsis;
		-webkit-line-clamp: 2;
		-webkit-box-orient: vertical
	}
}

.ex2 {
	display: flex;
	justify-content: space-between;

	.ex-title {
		padding-bottom: 7px;
		display: block;
		position: relative;

	}

}

.ex2-img {
	height: 21.3vw;
	overflow: hidden;
	display: flex;
	justify-content: space-between;

	.ex-img {
		display: block;
		width: 32%;
		min-height: 100%;
	}
}

.nav-list {
	overflow: hidden;
	overflow-x: scroll;
	white-space: nowrap;
	display: flex;
	height: 56px;
	align-items: center;
	position: relative;
	background-color: #4396f7;
	height: 56px;
}

.nav-a {
	color: rgba(255, 255, 255, .7);
	text-decoration: none;
	font-size: 16px;
	margin: 0px;
	padding: 0 10px;
	line-height: 28px;
	display: inline-block;
	height: 28px;
	position: relative;
}

.selected {
	font-weight: bold;
	color: #fff;
}

.selected .underLine {
	width: 15px;
	height: 1px;
	background: #FFF;
	bottom: 0px;
	left: 0px;
	right: 0px;
	margin: auto;
}
